import React from 'react';
import {DiNodejs} from "react-icons/di"
import style from "../styles/skills.module.css"

const Skills = () => {
    return (
        <div className={style.container}>
            <div className={style.hard}>
                <h2>Hard</h2>
            <DiNodejs size={150}/>
            </div>
        </div>
    );
};

export default Skills;
